import React from "react";
import ReactDOM from "react-dom";
import ReactApexChart from "react-apexcharts";

export class Chart1 extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      series: [
        {
          name: "High - 2013",
          data: [28, 29, 33, 36, 32, 32, 33]
        },
        {
          name: "Low - 2013",
          data: [12, 11, 14, 18, 17, 13, 13]
        }
      ],
      options: {
        chart: {
          height: 350,
          width: 1500,
          type: 'line',
          dropShadow: {
            enabled: true,
            color: '#000',
            top: 18,
            left: 7,
            blur: 10,
            opacity: 0.2
          },
          toolbar: {
            show: false
          }
        },
      }
    };
  }

  render() {
    return (
      div.chart
    );
  }
}

const domContainer = document.querySelector("#root");
ReactDOM.render(React.createElement(Chart1), domContainer);
